		var WACContainerId = 'WopiDocWACContainer';
		function loadWacHost(onload) {

				window.setTimeout(function() { loadWacHost(onload); }, 100);
			} else {
				require(['odsp-next/roots/WacHost'], function (wacHostModule) {

		function initializeWopiPending (appName, isPrague, initParams) {
			if (isPrague) {
				return Microsoft.Office.Prague.Word.Application.InitializeWopiPending(initParams);
			} else {
				return Microsoft.Office[appName].Application.InitializeWopiPending(initParams);

		var WacInitializer =  (function () {

						var diagClient = window.wopiDiagClient;
						var wopiDiagnostics = {

							client: diagClient,
							server: window.wopiDiagServer

							}
						});
					}
				};
				this.onInitFail = function (error, diagnostics) {
					if (!_this.isInitCompleted()) {
						_this._state = 4 ;
						_this.log("Initialization failed. Error: " + error.errorType + ". Diagnostics: " + JSON.stringify(diagnostics));
						_this.logQosOnFailure(error.errorType, 1 );
					}
				};
				this.onTimeout = function () {
					if (_this._state === 2 ) {
						_this._state = 4 ;
						var err = 'Initialization timed out.';
						_this.log(err);
						var qosStartTime = window.wopiDiagClient.wopiInitTime;
						loadWacHost(function (wacHost) {
							if(document.visibilityState === 'visible')
							{
							   wacHost.logWacInitializationQoS(qosStartTime, 1 , 'WacInit timed out', err);
							}
							else
							{
							   wacHost.logWacInitializationQoS(qosStartTime, 2 , 'WacInit timed out for not focus', err);
							}
							wacHost.logScriptQos(qosStartTime, _this._scriptError, _this._scriptWarning);
							wacHost.postLogging(undefined  );
						});
					}
				};
				this.onUnload = function () {
					if (_this._state === 2 ) {
						_this._state = 4 ;
						_this.logQosOnFailure('User navigated away.', 2 );
					}
				};
				this._state = 0 ;
				this._appName = appName;
				this._bootstrapperUrl = bootstrapperUrl;
				this._wopiDocContext = wopiDocContext;
				window.g_WACDone = false;
			}
			WacInitializer.prototype.start = function (wopiAuthInfo) {
				var clickTime = this.getClickTime();
				var entryPoint = this.getOrigin();
				try {
					var clientDiagnostics = window.wopiDiagClient;
					var wopiDocContext = this._wopiDocContext;
					var container = document.getElementById(WACContainerId);
					if (!container) {
						throw "Cannot find the element " + WACContainerId + ".";
					}
					this._initParams = {
						BootstrapperUrl: this._bootstrapperUrl,
						Container: container,
						SessionInformation: {
							HostName: wopiDocContext.HostName,
							HostSessionId: wopiDocContext.SessionId,
							UserId: wopiDocContext.UserId,
							DocumentClickTime: clickTime,
							EntryPoint: entryPoint
						},
						WopiInfo: wopiAuthInfo,
						ApplicationUrl: wopiDocContext.WebAppUrl.replace(/([&?])WOPISrc=&/, '$1'),

							FileGetUrl: wopiDocContext.FileGetUrl,

							ETag: wopiDocContext.ETag,
							ViewOnly: wopiDocContext.ViewOnly,
							HostGeo: wopiDocContext.HostGeo,
							PreseededSessionKey: wopiDocContext.PreseededSessionKey,
							PreseededWacSessionId: wopiDocContext.PreseededWacSessionId,
							SupportsDecryptedContentDownload: wopiDocContext.LabelIrmed,
							OpenViewByDefault: isWacViewMode,
							ClientThrottlingProtection: clientThrottlingProtection,
							RequestedCallThrottling: requestedCallThrottling
						},
						ApplicationCustomSettings: {
							ForceAccessibilityMode: false
						},
						Diagnostics: {
							entryPoint: entryPoint,
							userClickTime: clickTime,
							hostPageFirstFlushTime: clientDiagnostics.docFirstFlushTime,
							officeBootstrapperStartTime: clientDiagnostics.bootJsStartTime,
							officeBootstrapperEndTime: clientDiagnostics.bootJsEndTime
						},
						FnOnInitializeSuccess: this.onInitSuccess,
						FnOnInitializeFailure: this.onInitFail

						this._initParams.WopiPrecheckInfo.BundleInfo = this.getBundleInfo(wopiDocContext);

						this._initParams.NewFileTemplateSource = wopiDocContext.TemplateInfo;

						throw "Failed to initialize WAC.";
					}

				catch (err) {
					this._scriptError = (err && err.message ? err.message : "process param to JsApi error.") + ", CDN Path: " + this._bootstrapperUrl;
					throw err;
				}
			};
			WacInitializer.prototype.complete = function (wopiDocAuthInfo, wopiDocFileInfo) {
				if (this._wopiPendingApp != null) {

					}

					this.log("WacInitializer.complete: _wopiPendingApp is null and skip calling complete().");
				}
			};
			WacInitializer.prototype.fail = function (message) {

					this._state = 4 ;
					this.log("Failed: " + message);

			};

				var qosStartTime = window.wopiDiagClient.wopiInitTime;
				loadWacHost(function (wacHost) {
					wacHost.logWacInitializationQoS(qosStartTime, qosResult, 'WacInit failed', message);
					wacHost.logScriptQos(qosStartTime, _this._scriptError, _this._scriptWarning);
				});
			};
			WacInitializer.prototype.log = function (message) {
			};
			WacInitializer.prototype.getOrigin = function () {
				if (!this._origin) {
					this.populateOriginAndClickTime();
				}
				return this._origin;
			};
			WacInitializer.prototype.getClickTime = function () {
				if (!this._clickTime) {
					this.populateOriginAndClickTime();
				}
				return this._clickTime;
			};
			WacInitializer.prototype.populateOriginAndClickTime = function () {
				try {
					var origin = this._wopiDocContext.Origin;
					if (this._wopiDocContext.ClickTime) {
						this._clickTime = this._wopiDocContext.ClickTime;
					}
					else if (window.sessionStorage && !this._wopiDocContext.ClickTime) {
						var queryStr = document.location.search;
						queryStr = unescape(queryStr);
						if (queryStr) {
							var idStart = queryStr.indexOf("sourcedoc=");
							var idEnd = queryStr.substring(idStart).indexOf("&");
							var srcId = (idEnd === -1) ? queryStr.substring(idStart) : queryStr.substring(idStart, idStart + idEnd);
							var userClickKey = "WOPIPerf_UserClick_" + escape(srcId);
							var userClickTime = window.sessionStorage.getItem(userClickKey);
							if (userClickTime) {
								origin = "DocLib";
							}
							window.sessionStorage.removeItem(userClickKey);
							this._clickTime = Number(userClickTime);
						}
					}
					else {
						this._clickTime = 0;
					}
					this._origin = origin ? origin : "Other";
				}

					this._scriptWarning = err && err.message ? err.message : "process UserClick queryString error. ";

						storageToken: pragueProperties.StorageToken,
						navSite: pragueProperties.NavSite

					Url: wopiDocContext.BundleUrl

		function getRefreshCount() {
			var regex = new RegExp('[\?&]refreshcount=([^&#]*)');
			var rs = regex.exec(location.search);
			return (rs == null || isNaN(Number(rs[1]))) ? 0 : Number(rs[1]);
		}
		function refreshIfNecessary(refreshUri, tokenExpiry) {
			if (window.refreshIfTokenExpired) {
				if (tokenExpiry.getTime() - new Date().getTime() < 300000 && refreshUri) {
					window.location.replace(refreshUri + "&refreshcount=" + (getRefreshCount() + 1));
				}
			}
		}
		function initializeWac() {
			window.wopiDiagClient.bootJsEndTime = new Date().getTime();

			window.wacInitializer = wacInitializer;
			try {
				refreshIfNecessary(window.refreshUri, window.wopiAuthInfo.AccessTokenExpiry);
				if (window.serverErr) {
					wacInitializer.fail(window.serverErr);
				} else {
					wacInitializer.start(window.wopiAuthInfo);
					var wopiAuthInfo = window.wopiAuthInfo;
					if (wopiAuthInfo && wopiAuthInfo.AccessToken) {
						wacInitializer.complete(window.wopiAuthInfo, window.wopiFileInfo);
					}
				}
			}
			catch (err) {
				wacInitializer.fail(err);
			}
		}
		function onLoadJsApiFailed() {
			window.wopiDiagClient.bootJsEndTime = new Date().getTime();
			var wacInitializer = new WacInitializer(window.appName, window.bootstrapperUrl, window._wopiContextJson);
			wacInitializer.fail("failed to load JsAPI");
		}
		window.wopiDiagClient.bootJsStartTime = new Date().getTime();
